package main

import (
	"fmt"
	"math/big"
)

// source: https://www.hackerrank.com/challenges/three-month-preparation-kit-recursive-digit-sum/problem
func superDigit(n string, k int32) *big.Int {
	sum := new(big.Int)
	for _, letter := range n {
		num := new(big.Int)
		num.SetString(string(letter), 10)
		sum.Add(sum, num)
	}

	// Multiply the sum by k
	sum.Mul(sum, big.NewInt(int64(k)))

	// Calculate the super digit of the sum
	sum.Mod(sum, big.NewInt(9))
	if sum.Cmp(big.NewInt(0)) == 0 {
		return big.NewInt(9)
	}

	return sum
}

func main() {

	s := ``
	k := int32(100000)

	fmt.Println(superDigit(s, k))
}
